import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    getApi();
  }, []);

  const getApi = async () => {
    const response = await fetch("https://jsonplaceholder.typicode.com/users");
    const data = await response.json();
    console.log(data);
  };

  return <div>App</div>;
};

export default App;
